extra credit: think about the Moon’s home in Cancer and exaltation in Taurus; 
Taurus, represented by a horned cow, and Cancer, so replete with milk;
the Moon, whose crescent creates the cow’s horns, and whose fullness is like that of a bucket overflowing;
the Moon, who marks time with Her waxing and Her waning, and whose longer secret cycles carve epochs and eras;
the Moon, who moves the waters of sea and flesh;
the Moon, who reminds us to eat, to dream, to digest.

